import { generate } from "shortid";
import styles from "./ContactsList.module.css";

const ContactsList = ({ list }) => {
  const AddNewContacts = list.map((item) => {
    const { contact } = item;
    const { id } = generate();
    return (
      <li key={id} className={styles.Item}>
        {contact}
      </li>
    );
  });
  return (
    <>
      <ul>
        <AddNewContacts />
      </ul>
    </>
  );
};

export default ContactsList;
